import styled from 'styled-components'

export const LoginWrapper = styled.div`
  height: 100vh;
  background-image: url(${(props) => props.login});
  opacity: 0.8;
`
export const Form = styled.form`
  display: flex;
  justify-content: center;
  flex-direction: column;
  align-items: center;
  width: 100px;
`
